import { ActionReducerMap } from "@ngrx/store";
import { Counter, counterReducer } from "./reducers/counter.reducer";

export interface StoreInterface{
    counter: Counter
}

export interface CutomAction{
    type:string,
    payload:any
}


export const reducers: ActionReducerMap<StoreInterface> = {counter: counterReducer | any}
